import React, { Component, Fragment } from "react";
//import { Link } from "react-router-dom";

import "./Cgv.scss";

class Cgv extends Component {
  render() {
    return (
      <Fragment>
        <h2 id="cgv1">I. Conditions Générales d’Utilisation Acheteurs</h2>
        <p>Préambule</p>
        <p>
          La Place de Marché est un service proposé par SneakerBis, Siège social
          : 37 rue des Fauvelles 92400 Courbevoie
        </p>
      </Fragment>
    );
  }
}

export default Cgv;
